docblock.long-description:
- The command returns the `Contact_Information` for a specific contact ID
- This command runs synchronously on the server

## Example:
```
$contact_id = new Entity\Contact_Id( 'SP1:5499554' );
$command = new Command\Contact\Details( $contact_id );

$response = $api->post( $command );
if ( $response->is_success() ) {
    $contact_information = $response->get_contact_information();
}
```

- This command returns all the DNS records associated with a domain
- Runs synchronously on the server

Example usage:

```
$domain_name = new Entity\Domain_Name( 'example-domain.com' );
$command = new Command\Dns\Get( $domain_name );

$response = $api->post( $command );

if ( $response->is_success() ) {
    // $dns_records is an Entity\Dns_Records instance
    $dns_records = $response->get_dns_records();
}
```

- This command sets the DNS records associated with a domain
- Any existing records are replaced by the new records
- Runs synchronously on the server

Example usage:

```
$domain_name = new Entity\Domain_Name( 'example-domain.com' );
$records_array = [
    [
        'name' => 'www',
        'type' => 'CNAME',
        'ttl' => 3600,
        'data' => [ 'example-domain.com.' ]
    ],
    [
        'name' => '@',
        'type' => 'A',
        'ttl' => 3600,
        'data' => [ '1.2.3.4' ]
    ],
];
$dns_record_sets = Entity\Dns_Record_Sets::from_array( $records_array );

$dns_records = new Entity\Dns_Records( $domain_name, $dns_record_sets );
$command = new Command\Dns\Set( $dns_records );

$response = $api->post( $command );

if ( $response->is_success() ) {
    $domain_name = $response->get_domain_name();
    $records_added = $response->get_records_added();
    $records_deleted = $response->get_records_deleted();
}
```

- This command deletes a domain from the reseller's account
- After you delete a domain, it may be impossible to register it again
- Runs asynchronously on the server
- Reseller will receive a `Domain\Delete\Success` or `Domain\Delete\Fail` event depending on the result of the
  command

Example usage:

```
$domain_name = new Entity\Domain_Name( 'example-domain.com' );
$command = new Command\Domain\Delete( $domain_name );

$response = $api->post( $command );

if ( $response->is_success() ) {
    // command was issued correctly, the client should wait for a `Domain\Delete\Success` or
    // `Domain\Delete\Fail` event
}
```

- This command requests a new domain registration
- It runs asynchronously on the server
- Reseller will receive a Domain\Register\Success or Domain\Register\Fail event depending on the result of the
  command

Example usage:
```
$domain_name = new Entity\Domain_Name( 'example.com' );
$contact_info = [
  'first_name' => 'John',
  'last_name' => 'Doe',
  'organization' => '',
  'address_1' => '60 29th Street #343',
  'address_2' => '',
  'postal_code' => '94110',
  'city' => 'San Francisco',
  'state' => 'CA',
  'country_code' => 'US',
  'email' => 'registrar@automattic.com',
  'phone' => '+1.8772733049',
  'fax' => null,
];
$contacts = Entity\Domain_Contacts::from_array(
  [
    'owner' => [ 'contact_information' => $contact_info ],
    'admin' => [ 'contact_information' => $contact_info ],
  ]
);
$name_servers = new Entity\Nameservers(
  new Entity\Domain_Name( 'ns1.example.com' ),
  new Entity\Domain_Name( 'ns2.example.com' ),
);
$dns_records = new Entity\Dns_Records(
  $domain,
  new Entity\Dns_Record_Sets(
    new Entity\Dns_Record_Set(
      '@',
      new Entity\Dns_Record_Type( Entity\Dns_Record_Type::A ),
      3600,
      [
        '1.2.3.4',
        '5.6.7.8',
      ]
    )
  )
);
$command = new Command\Domain\Register(
    $domain_name,
    $contacts,
    1,
    $name_servers,
    $dns_records,
    Entity\Whois_Privacy::ENABLE_PRIVACY_SERVICE,
    null
);
$response = $api->post( $command );
if ( $response->is_success() ) {
  // The register request was successfully queued.
}
```

- This command renews a domain for a specified number of years
- The required parameters are:
    - `domain_name` - the domain to renew
    - `period` - number of years to renew the domain
    - `current_expiration_year` - in which year the domain is currently going to expire (used to prevent unwanted
      multiple renewals)
- Optional parameter:
    - `fee_amount` - used when renewing premium domains because they have special pricing
- Runs asynchronously on the server
- Reseller will receive a `Domain\Renew\Success` or `Domain\Renew\Fail` event depending on the result of the command

Example usage:

```
$domain_name = new Entity\Domain_Name( 'example-domain.com' );
$current_expiration_year = 2022;
$period = 1;

$command = new Command\Domain\Renew( $domain_name, $current_expiration_year, $period );

$response = $api->post( $command );

if ( $response->is_success() ) {
    // domain was renewed successfully
}
```

- This command requests a restore for the specified domain.
- May only be used when a domain is in the redemption period. (Usually days 45-75 after expiration for most TLDs)
- Restoring a domain will usually also renew the domain for another year from the expiration date.
- Restoring a domain usually incurs an additional fee over the regular renewal cost.
- Note that not all TLDs support redemption.
- The actual restore is processed asynchronously on the server. The result of the actual restore operation will be
  returned in an event.

Example usage:
```
$domain_name = new Entity\Domain_Name( 'example.com' );
$command = new Command\Restore( $domain_name );
$response = $api->post( $command );
if ( $response->is_success() ) {
       // The restore request was successfully queued.
}
```

- This command updates any or all of a domain's contacts.
- Contact types not included in the request would not be updated, but won't be deleted.
- For each contact type, either a contact ID or the full contact information can be provided.
- If contact information is provided, a new contact will be created and the contact ID will be returned.
- This command runs asynchronously on the server.
- Getting a success response means that the operation was queued successfully.
- A domain has four contact types: owner, admin, tech and billing

## Example:
```
$domain_name = new Entity\Domain_Name( 'example.com' );
$contact_id = new Entity\Contact_Id( 'SP1:5499554' );
$domain_contacts = new Entity\Domain_Contacts();

$domain_contacts->set_owner( new Entity\Domain_Contact( $contact_id ) );
$domain_contacts->set_billing( new Entity\Domain_Contact( $contact_id ) );

$command = new Command\Domain\Set\Contacts( $domain_name, $domain_contacts );

$response = $api->post( $command );
if ( $response->is_success() ) {
    // The update request was queued successfully
}
```

- Runs asynchronously on the server
- Reseller will receive a `Domain\Set\Nameservers\Success` or `Domain\Set\Nameservers\Fail` event depending on the
  result of the operation

Example usage:

```
$domain_name = new Entity\Domain_Name( 'example-domain.com' );
$nameservers_array = [
    new Entity\Domain_Name( 'ns1.wordpress.com' ),
    new Entity\Domain_Name( 'ns2.wordpress.com' ),
];
$nameservers = new Entity\Nameservers( $nameservers_array );
$command = new Command\Domain\Set\Nameservers( $domain_name, $nameservers );

$response = $api->post( $command );

if ( $response->is_success() ) {
    // command was issued successfully, the client should wait for a `Domain\Set\Nameservers\Success` or
    `Domain\Set\Nameservers\Fail event`
}
```

- Runs asynchronously on the server
- Reseller will receive a Domain\Set\Privacy\Success or Domain\Set\Privacy\Fail event depending on the result of the
command

Example:
```
$domain_name = new Entity\Domain_Name( 'example-domain.com' );
$privacy_setting = new Entity\Whois_Privacy( Entity\Whois_Privacy::ENABLE_PRIVACY_SERVICE );
$command = new Command\Domain\Set\Privacy( $domain, $privacy_setting );
$response = $api->post( $command );
if ( $response->is_success() ) {
  // the request to update the privacy setting was queued successfully
}
```
